import './ChatMini.css';

function ChatMini(props){

  return(
    <div className="chatmini-container">
      <div className="chatmini-title">
        <span>test{props.iduser}</span>
      </div>
      <div className="chatmini-body">
        test{props.iduser}
      </div>
    </div>
  )
}

export default ChatMini;
